import React from 'react'
import ReactDOM from 'react-dom';
import './GalleryIndex.css'
import SideDivWithBtn from '../../../general/SideDivWithBtn/SideDivWithBtn'

class GalleryIndex extends React.Component {
  constructor(props) {
       super(props);
       this.state = {
       };
  }
  onBtnClicked(event) {
      this.setState({isBtnClicked: !this.state.isBtnClicked})
  }
  render() {
    return (
    <div>
      <div className='myGallery row mt-5 mr-5 text-center'>
        <div className='image-inner zoom nails col-md-3 mt-5 ml-5 mr-5'>
          <a href='/MyGallery'>
            <div className='inDiv'>
              <h1 className='welcome1'>Nails! </h1>
            </div>
          </a>
        </div>
        <SideDivWithBtn
          isBtnIn='1'
          inClass='image-inner zoom nails mt-5 ml-5 mr-5'
          hClass='welcome1'
          title=' Nails!'
          href='/MyGallery'
          innerElem='inDiv'
        />

        <div className='image-inner zoom fashion col-md-3 mt-5 ml-5'>
          <h1 className='welcome1'>Fashion! </h1>
        </div>
        <div className='image-inner zoom beauty col-md-3 mt-5 ml-5'>
          <h1 className='welcome1'> Beauty! </h1>
        </div>
      </div>
    </div>
  );
  }
}

export default GalleryIndex;
